// src/App.js
import React from 'react';
import './App.css'; // for basic styling
import UserCard from './UserCard'; // our upcoming component

function App() {
  return (
    <div className="App">
      <UserCard name="Shreya wallalwar" email="wallalwarshreya@gmail.com"
       age={20} />
    </div>
  );
}

export default App;
